ter',fAc='DelayedRunnable',gAc='DelayedRunnable$1',Zdc='Deutsch',nec='Dez',kec='Dezember',Lec='Di',Eec='Di.',qwc='DialogBox',wwc='DialogBox$1',uwc='DialogBox$CaptionImpl',vwc='DialogBox$MouseHandler',Cpc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",xec='Dienstag',iAc='Dimension',Elc='Dimension [height=',xwc='DirectionalTextHelper',Nec='Do',Gec='Do.',Awc='DockLayoutPanel',Bwc='DockLayoutPanel$Direction',Cwc='DockLayoutPanel$Direction;',Fwc='DockLayoutPanel$DockAnimateCommand',Dwc='DockLayoutPanel$LayoutData',Isc='DomEvent',Nsc='DomEvent$Type',zec='Donnerstag',Syc='Double',Aic='EAST',Ibc='EEE, d MMM yyyy HH:mm:ss Z',woc='EEE. dd MMM. yyyy HH:mm:ss',acc='EEEE d. MMMM',Lbc='EEEE, d. MMMM y',eac='EM',Dgc='EMPTY',Igc='ENABLED',$ec='END',gac='EX',cvc='ElementMapperImpl',dvc='ElementMapperImpl$FreeNode',$dc='English',Urc='Enum',Rdc='Etc/GMT',Tdc='Etc/GMT+',Sdc='Etc/GMT-',yac='Event type',Yxc='Event$NativePreviewEvent',$sc='EventBus',irc='EventObject',nrc='Exception',fhc='Expecting version 6 from server, got ',ubc='F',Fmc='F8834F07517EF3B7D02B9E845E5E1B88',_9b='FIXED',Dhc='FLOAT',kmc='Fail: ',kdc='Feb',pec='Feb.',eec='Februar',$cc='February',bqc='Female',Tyc='Float',Gwc='FlowPanel',ewc='FocusWidget',Gkc='For input string: "',Oec='Fr',Hec='Fr.',Aec='Freitag',Mdc='Fri',Ddc='Friday',Mac='GET',Noc='GGD55XLBAH',zqc='GGD55XLBAJ',Mpc='GGD55XLBBI',Moc='GGD55XLBCH',Opc='GGD55XLBCI',egc='GGD55XLBDB',Loc='GGD55XLBDH',Iqc='GGD55XLBDJ',vpc='GGD55XLBDK',Tfc='GGD55XLBEB',Joc='GGD55XLBEH',Npc='GGD55XLBEI',Aqc='GGD55XLBEJ',fgc='GGD55XLBFB',Qoc='GGD55XLBFH',jqc='GGD55XLBFI',_qc='GGD55XLBFK',gqc='GGD55XLBGI',Zqc='GGD55XLBGK',igc='GGD55XLBHB',Yoc='GGD55XLBHH',Wpc='GGD55XLBHI',Yqc='GGD55XLBHK',$oc='GGD55XLBIH',Vqc='GGD55XLBIK',Zoc='GGD55XLBJH',Vnc='GGD55XLBJJ',$qc='GGD55XLBJK',jpc='GGD55XLBKG',Hpc='GGD55XLBKH',kqc='
